pragma solidity ^0.8.0;

contract ProductManager {
    struct Product {
        string productName;
        string description;
        string uniqueIdentifier;
    }

    Product[] public products;
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    function addProduct(string memory _productName, string memory _description, string memory _uniqueIdentifier) public {
        require(msg.sender == owner, "Only the owner can add products");
        products.push(Product(_productName, _description, _uniqueIdentifier));
    }

    function getProductCount() public view returns (uint) {
        return products.length;
    }

    function getProduct(uint _index) public view returns (string memory, string memory, string memory) {
        require(_index < products.length, "Product does not exist");
        Product memory product = products[_index];
        return (product.productName, product.description, product.uniqueIdentifier);
    }
}
